import{e as p}from"./app.630af5f2.js";import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";const a={},r=p('<h1 id="y" tabindex="-1"><a class="header-anchor" href="#y" aria-hidden="true">#</a> Y\u2026</h1><p>\u4ED6\u628A\u5979\u56FA\u5B9A\u5728\u5854\u697C\u4E4B\u5916\u7684\u94C1\u94FE\u3002</p><p>\u90A3\u4E9B\u94C1\u94FE\u7CFB\u7531\u9876\u5C42\u7684\u516B\u8DDF\u77F3\u67F1\u5EF6\u4F38\u800C\u51FA\uFF0C\u4E00\u76F4\u8FDE\u63A5\u7740\u5927\u5730\u3002</p><p>\u96EA\u5C71\u4E0A\uFF0C\u5929\u7A7A\u4E2D\u5439\u7740\u9634\u51B7\u7684\u98CE\u3002</p><p>\u82CD\u5170\u8D64\u88F8\u7684\u8EAB\u4F53\u611F\u5230\u5BD2\u51B7\u3002</p><p>\u5728\u51DB\u51BD\u7684\u5BD2\u98CE\u4E2D\uFF0C\u686B\u6469\u6000\u6709\u4E00\u9897\u706B\u70ED\u7684\u5FC3\u548C\u9F9F\u5934\u3002</p><p>\u2026\u2026</p><p>\u300C\u4F60\u8FD9\u90AA\u6076\u7684\u5987\u4EBA\uFF01\u81F3\u4ECA\u65F6\u8FD8\u5984\u60F3\u6740\u6211\u3002\u53EF\u601C\u7684\u5973\u5B50\u554A\uFF0C\u4F60\u7A77\u5C3D\u673A\u667A\u4E5F\u654C\u4E0D\u8FC7\u9B54\u9B3C\u7684\u88C1\u51B3\uFF01\u4F60\u7684\u6027\u5668\u597D\u6BD4\u8BF1\u4EBA\u7684\u9677\u9631\uFF0C\u4F60\u7684\u5507\u820C\u53EA\u4E3A\u53E3\u4EA4\u548C\u6492\u8C0E\u800C\u751F\uFF01\u4F60\u7684\u8EAB\u4F53\u90A3\u6837\u7684\u6DEB\u8361\u7684\u8FCE\u5408\u6211\uFF0C\u8BDD\u8BED\u53C8\u597D\u6BD4\u871C\u7CD6\uFF0C\u90A3\u5929\u4F7F\u4E00\u6837\u7EAF\u7F8E\u7684\u9762\u5B54\uFF0C\u85CF\u7740\u6BD4\u86C7\u880D\u8FD8\u6076\u6BD2\u7684\u5FC3\uFF01\u300D</p><p>\u686B\u6469\u7684\u811A\u8E29\u5728\u59D0\u59D0\u7684\u4E0B\u5DF4\uFF0C\u628A\u5979\u8E0F\u5728\u8E0F\u5854\u5C16\u7684\u659C\u9762\u3002\u51B7\u98CE\u5439\u52A8\u5979\u90A3\u767D\u8272\u7684\u7FBD\u7FFC\uFF0C\u8D64\u88F8\u7740\u8EAB\u4F53\uFF0C\u4E73\u5934\u90FD\u633A\u7ACB\u8D77\u6765\u3002</p><p>\u300C\u5206\u660E\u662F\u795E\u5723\u7684\u7FFC\uFF0C\u5374\u8981\u7528\u5B83\u6765\u6740\u4EBA\u3002\u5206\u660E\u662F\u540C\u751F\u7684\u59D0\u5F1F\uFF0C\u5374\u5B58\u6709\u5F02\u7C7B\u7684\u504F\u89C6\uFF01\u6211\u4E3A\u4F60\u7F9E\u803B\u554A\uFF0C\u4E3A\u4F60\u7F9E\u803B\uFF01\u4E3A\u4F55\u56FD\u65CF\u7684\u5927\u4E49\uFF0C\u504F\u504F\u5EFA\u7ACB\u8FD9\u90A3\u4E48\u591A\u7684\u4EC7\u6068\u548C\u6740\u622E\u4E4B\u4E0A\uFF01\u300D</p><p>\u82CD\u5170\u89C9\u5F97\u8EAB\u4F53\u4E00\u9635\u6E29\u70ED\u3002\u686B\u6469\u6B63\u7528\u5C3F\u6DB2\u6D17\u6DA4\u3002</p><p>\u300C\u4F60\u8FD9\u98A0\u72C2\u7684\u5987\u4EBA\uFF0C\u6211\u7684\u4E00\u6CE1\u5C3F\u90FD\u6BD4\u4F60\u6E05\u6F88\uFF01\u5FFF\u6012\uFF0C\u6B3A\u9A97\uFF0C\u6740\u8650\uFF0C\u6DEB\u884C\u3002\u8FD9\u4E9B\u90FD\u662F\u4F60\u72AF\u7684\u91CD\u7F6A\u3002\u4E00\u5DF1\u504F\u6267\u7684\u6743\u5A01\uFF0C\u7ADF\u8FDE\u4EB2\u60C5\u90FD\u5C06\u629B\u5F03\uFF01\u6211\u8981\u72E0\u72E0\u88C1\u51B3\u4F60\uFF01\u8BA9\u4F60\u6000\u5B55\u4E71\u4F26\u7684\u80CE\uFF0C\u8499\u53D7\u6700\u51C4\u82E6\u7684\u56DE\u8F6E\u3002\u300D</p><p>\u300C\u5514\u2026\u2026\u300D</p><p>\u300C\u770B\u54EA\uFF0C\u6211\u7684\u59D0\uFF0C\u6211\u7684\u5973\u7687\u3002\u90A3\u7247\u8FDC\u65B9\u98DE\u6765\u7684\u4E91\u2014\u2014\u90A3\u662F\u5929\u7A7A\u57CE\u503E\u5DE2\u800C\u51FA\u7684\u6218\u961F\uFF01\u4ED6\u4EEC\u5373\u5C06\u98DE\u4E34\uFF01\u6211\u8981\u4F60\u770B\uFF0C\u6211\u8981\u4ED6\u4EEC\u770B\u6211\u600E\u6837\u884C\u7F5A\uFF01\u300D</p><p>\u4ED6\u62B1\u8D77\u5979\u5B34\u5F31\u7684\u8EAB\u8EAF\uFF0C\u76D8\u65CB\u5728\u6B7B\u57CE\u4E0A\u7A7A\u2014\u2014</p><p>\u300C\u59EC\u5A1C\u3002\u8D1D\u73B2\u8FBE\u3002\u6211\u8981\u4F60\u4EEC\u7EDF\u7387\u6240\u6709\u6B7B\u53BB\u4E27\u5C38\uFF0C\u8FCE\u51FB\u5916\u65CF\u7684\u654C\u3002\u65E5\u843D\u4E4B\u524D\uFF0C\u8FD9\u57CE\u5185\u4E0D\u518D\u6709\u751F\u547D\u7684\u8FF9\u3002\u800C\u6211\uFF0C\u4E5F\u7528\u7CBE\u6DB2\u6D17\u6DA4\u3002\u5728\u654C\u519B\u6218\u9F13\u6572\u54CD\u7684\u65F6\u5206\uFF0C\u6211\u5F00\u59CB\u5978\u6DEB\u4ED6\u4EEC\u7684\u795E\u5973\uFF0C\u5728\u4ED6\u4EEC\u6B7B\u524D\uFF0C\u5FC5\u4EE4\u5979\u6000\u5B55\u3002\u300D</p><p>\u686B\u6469\u628A\u59D0\u59D0\u653E\u5728\u5C38\u9AB8\u4E4B\u4E0A\uFF0C\u6574\u4E2A\u6218\u573A\u4E2D\u592E\u3002</p><p>\u5728\u4ED6\u4EEC\u7684\u5468\u56F4\uFF0C\u662F\u4E00\u7FA4\u52A8\u4F5C\u8E52\u8DDA\u7684\u4E27\u5C38\uFF0C\u5996\u86C7\u548C\u8718\u86DB\u7387\u9886\u7740\u4E07\u9B54\u7684\u519B\u961F\uFF0C\u8FCE\u6218\u5916\u6765\u7684\u654C\u3002</p><p>\u4E24\u53EA\u53D8\u578B\u7684\u5996\u5B7D\uFF0C\u7545\u5FEB\u996E\u8840\u3002\u5B83\u4EEC\u66FE\u90A3\u6837\u7684\u7EAF\u6D01\uFF0C\u53EA\u56E0\u88AB\u90AA\u6076\u837C\u6BD2\uFF0C\u60DF\u6709\u4FE1\u5949\u8FD9\u6837\u90AA\u6076\u7684\u65B9\u5F0F\u3002\u5982\u6B64\u75F4\u8FF7\u6740\u622E\uFF0C\u6028\u5FFF\u5982\u9B3C\u755C\u3002\u6EAA\u6D41\u53D8\u6210\u8840\u6CB3\uFF0C\u66FE\u7ECF\u4E3A\u59B9\u59B9\u68B3\u8FC7\u5934\u53D1\u7684\u5730\u65B9\u3002</p><p>\u8FD9\u7FA4\u9B54\u4E71\u821E\u7684\u575F\u573A\u3002\u6218\u9F13\uFF0C\u9B3C\u54ED\uFF0C\u60B2\u58EE\u3002</p><p>\u4ED6\u63D2\u5979\u7684\u8282\u594F\u8F7B\u5FEB\uFF0C\u627F\u63A5\u7740\u5979\u7684\u6B22\u3002\u6B8B\u80A2\u65AD\u81C2\u98DE\u6765\uFF0C\u626F\u52A8\u7740\u9C9C\u8840\u5982\u4E1D\u5E26\uFF0C\u8FD9\u822C\u6D41\u5149\u98DE\u821E\u3002</p><p>\u57CE\u5E02\u5185\u5C3D\u662F\u5929\u7A7A\u7684\u6218\u9F13\u548C\u4E27\u5C38\u7684\u547B\u541F\uFF0C\u9C9C\u8840\u5982\u82CD\u5170\u7684\u6DEB\u6DB2\u4E00\u6837\u5A46\u5A11\uFF0C\u86C7\u8179\u5728\u8089\u8EAB\u722C\u884C\u3002\u5929\u7A7A\u7684\u6218\u5C06\u5E26\u7740\u5C48\u8FB1\u7684\u58EE\u5FD7\uFF0C\u6740\u58F0\u60CA\u5BC2\u5929\u5730\u3002\u5C31\u8FDE\u4ED6\u4EEC\u7684\u5750\u9A91\uFF0C\u90FD\u56F4\u653B\u7740\u5544\u98DF\u86C7\u5996\u3002\u58EB\u5175\u5411\u6F6E\u6C34\u4E00\u6837\u6D8C\u5411\u4E2D\u592E\uFF0C\u773C\u5149\u6D41\u51FA\u7329\u7EA2\u7684\u6740\u6C14\uFF0C\u4ED6\u4EEC\u780D\u6740\u7740\u6050\u6016\u7684\u9B54\u519B\uFF0C\u65E0\u754F\u8EAB\u6B7B\u3002</p><p>\u5F53\u4ED6\u4EEC\u63A5\u8FD1\u4E2D\u592E\uFF0C\u5374\u770B\u89C1\u5973\u7687\u50CF\u5A4A\u5B50\u4E00\u6837\u5FD8\u5F62\uFF0C\u81E3\u670D\u5728\u6076\u9B54\u7684\u9634\u830E\u3002\u686B\u6469\u628A\u59D0\u59D0\u633A\u5728\u4E0A\u9762\u7684\u4F53\u4F4D\uFF0C\u7EC6\u8F6F\u7684\u9634\u6BDB\u6469\u5230\u4ED6\u5C0F\u8179\u5FAE\u75D2\u3002\u82CD\u5170\u662F\u5C48\u8FB1\u7684\uFF0C\u65E5\u5149\u7167\u5C04\u5728\u5979\u767D\u7389\u4E00\u6837\u7684\u8EAB\u4F53\uFF0C\u5374\u52A9\u957F\u5979\u8EAB\u4F53\u95F7\u70ED\u3002</p><p>\u5929\u7A7A\u57CE\u5E76\u672A\u8CF8\u4F59\u7537\u5B50\u3002\u51E1\u8001\u4EBA\u548C\u5E7C\u7AE5\uFF0C\u6559\u5F92\u548C\u50E7\u4FA3\uFF0C\u5546\u8D29\u548C\u5DE5\u5320\u4FF1\u662F\u503E\u5DE2\u800C\u51FA\u3002\u6BEB\u4E0D\u601C\u60DC\u751F\u547D\uFF0C\u53EA\u4E3A\u6551\u8D4E\u82CD\u5170\u800C\u6218\u3002</p><p>\u57CE\u5E02\u5C06\u9668\u843D\u4E86\uFF0C\u5374\u8981\u625E\u536B\u81EA\u5DF1\u7684\u7687\u3002\u5018\u4F7F\u5973\u7687\u4E5F\u5815\u843D\uFF0C\u4FBF\u662F\u518D\u65E0\u751F\u673A\u3002</p><p>\u5979\u7684\u53CC\u624B\u6309\u5728\u4E73\u623F\uFF0C\u4E73\u623F\u6446\u52A8\u7684\u65F6\u5019\u5C31\u4F1A\u4E0D\u7531\u81EA\u4E3B\u7684\u9AD8\u58F0\u3002\u6602\u9996\u633A\u8170\uFF0C\u5982\u6B64\u6FC0\u6602\u59FF\u52BF\uFF0C\u5C31\u4F3C\u66FE\u7ECF\u6218\u573A\u6B7C\u654C\u3002\u8FD9\u4EE4\u4EBA\u656C\u754F\u7684\u5973\u7687\uFF0C\u8FDE\u5996\u9B54\u90FD\u79F0\u5979\u4E3A\u5996\u9B54\u3002\u6B64\u523B\u9AD8\u9AD8\u7FD8\u8D77\u4E30\u7F8E\u7684\u81C0\u90E8\uFF0C\u4EE4\u4ED6\u4ECE\u5BB9\u62BD\u52A8\u3002</p><p>\u686B\u6469\u72C2\u8E81\u7684\u7B11\u5BB9\uFF0C\u76D6\u8FC7\u82F1\u96C4\u6C14\u77ED\uFF0C\u4EA6\u76D6\u8FC7\u9B3C\u54ED\u6CE3\u72FC\u568E\u3002\u4ED6\u5728\u59D0\u59D0\u7684\u8EAB\u4E0B\uFF0C\u5728\u5979\u7684\u9634\u9053\u4E4B\u4E0B\uFF0C\u4F46\u7B11\u58F0\u4F9D\u7136\u5145\u65A5\uFF0C\u5982\u540C\u9006\u5929\u4E4B\u96F7\u3002\u5FFD\u7136\u80F8\u819B\u4E00\u9635\u70ED\u5EA6\uFF0C\u770B\u53BB\u2014\u2014\u7ADF\u662F\u82CD\u5170\u7684\u4E00\u6EF4\u6CEA\u3002</p><p>\u4ED6\u5F00\u59CB\u6124\u6012\u5730\u5486\u54EE\u3002\u56E0\u4E3A\u4ED6\u53EA\u7231\u89C1\u5979\u7684\u6DEB\u6DB2\u3002</p><p>\u82CD\u5170\u5C82\u4F1A\u770B\u4E0D\u89C1\uFF0C\u5C82\u4F1A\u770B\u4E0D\u89C1\u6D74\u8840\u594B\u6218\u7684\u90A6\u6C11\uFF1B\u5C82\u4F1A\u770B\u4E0D\u89C1\u81EA\u5DF1\u653E\u8361\u7684\u5F62\uFF1F</p><p>\u5F53\u4E00\u4E2A\u5973\u4EBA\u771F\u7684\u6781\u5C3D\u5C48\u8FB1\uFF0C\u6781\u5C3D\u6323\u624E\u5374\u4F9D\u7136\u633D\u4E0D\u56DE\u547D\u8FD0\u7684\u65F6\u5019\u3002\u5979\u7684\u4FE1\u4EF0\uFF0C\u771F\u7684\u4E0D\u8FC7\u4E00\u6EF4\u6CEA\u3002</p><p>\u6726\u80E7\u7684\u89C6\u91CE\u4E2D\uFF0C\u592A\u9633\u5F00\u59CB\u897F\u6C89\u3002\u90A3\u4E9B\u4E3A\u5979\u727A\u7272\u7684\u4EBA\u4EEC\uFF0C\u58F0\u52BF\u591A\u4E48\u6D69\u5927\uFF0C\u4E5F\u66FE\u4E00\u5EA6\u70B9\u71C3\u5E0C\u671B\u3002\u4F46\u65E5\u843D\u4E86\uFF0C\u6218\u9F13\u7684\u58F0\u97F3\u4E5F\u6E10\u5C0F\u4E86\uFF0C\u9634\u9053\u7684\u7EC6\u8F6F\u76AE\u80A4\u4E5F\u64E6\u7834\u4E86\u3002</p><p>\u5979\u5012\u584C\u5728\u5F1F\u5F1F\u7684\u80F8\u819B\uFF0C\u867D\u7136\u53C8\u4E00\u9635\u7684\u9AD8\u6F6E\u6765\u88AD\uFF0C\u4F46\u5979\u8FDE\u6323\u624E\u7684\u6C14\u529B\u90FD\u8017\u5C3D\uFF0C\u6700\u540E\u7684\u4F53\u6DB2\u6EF4\u843D\u6210\u4E00\u6EF4\u6CEA\uFF0C\u9634\u9053\u662F\u5E72\u6DA9\u7684\uFF0C\u65E0\u52A8\u4E8E\u8877\u7684\u3002\u90A3\u4E00\u53CC\u7FFC\u4E8E\u662F\u6CA6\u4E3A\u717D\u60C5\u7684\u6700\u540E\u9053\u5177\u3002</p><p>\u5915\u9633\u7684\u6295\u5F71\u4E0B\uFF0C\u7FC5\u8180\u7684\u8F6E\u5ED3\u98A4\u6296\uFF0C\u9759\u6B62\uFF0C\u98A4\u6296\uFF0C\u9759\u6B62\u3002</p><p>\u7EC8\u4E0D\u518D\u52A8\u5F39\u3002</p><p>\u5230\u65E5\u843D\u7684\u65F6\u5019\uFF0C\u6700\u540E\u4E00\u540D\u5929\u7A7A\u57CE\u5E02\u7684\u6218\u58EB\u88AB\u5206\u98DF\u3002</p><p>\u5929\u8FB9\u5F2F\u5F2F\u7684\u6708\u4EAE\uFF0C\u597D\u4F3C\u5973\u7687\u81C0\u90E8\u7684\u5F27\u7EBF\u3002</p><p>\u686B\u6469\u5C06\u9634\u830E\u62BD\u79BB\uFF0C\u5B83\u4F9D\u7136\u50CF\u7F28\u67AA\u4E00\u6837\u633A\u7ACB\u3002\u6EA2\u51FA\u6765\u7684\u767D\u8272\u7CBE\u6DB2\uFF0C\u7F13\u7F13\u6D41\u8FC7\u5979\u4E0B\u8EAB\u7684\u8F6E\u5ED3\uFF0C\u50CF\u662F\u704C\u6E89\u826F\u7530\u3002</p><p>\u90A3\u6761\u5996\u5A9A\u5EF6\u7740\u904D\u5730\u7684\u5C38\u8EAB\u722C\u884C\u6C47\u5408\u3002\u8D1D\u73B2\u8FBE\u8214\u5C3D\u82CD\u5170\u8EAB\u4E0A\u7684\u6C61\u79FD\uFF0C\u4EAB\u7528\u4E3B\u4EBA\u7684\u7CBE\u3002\u800C\u5E74\u5E7C\u7684\u59EC\u5A1C\u5728\u4E00\u65C1\uFF0C\u597D\u5947\u5730\u6253\u91CF\u5973\u7687\u7684\u72FC\u85C9\u88F8\u4F53\u548C\u53D1\u578B\u3002</p><p>\u300C\u6211\u7684\u4EC6\uFF0C\u4F60\u4EEC\u8981\u4F8D\u5949\u5979\u3002\u56E0\u4E3A\u6211\u5DF2\u4EE4\u5979\u6000\u5B55\u3002\u59EC\u5A1C\uFF0C\u4F60\u8981\u628A\u5979\u9A6E\u81F3\u5854\u9876\uFF1B\u8D1D\u73B2\u8FBE\uFF0C\u4F60\u4E5F\u6765\uFF0C\u6211\u5148\u8D4F\u4F60\u4EEC\u8214\u98DF\u6211\u9634\u830E\u4E0A\u7684\u5723\u6C34\u3002\u8981\u5206\u5C45\u6211\u7684\u5DE6\u53F3\u4FA7\uFF0C\u7531\u6211\u7684\u8DB3\u5C16\u5F00\u59CB\u5411\u4E0A\uFF0C\u8FD9\u662F\u6211\u7684\u6069\u610F\u3002\u300D</p><p>\u4EBA\u7C7B\u5DF2\u88AB\u6740\u5149\uFF0C\u4E00\u7FA4\u4E27\u5C38\u7ADF\u5F00\u59CB\u4E92\u76F8\u5636\u54AC\u3002\u4E00\u4E9B\u6218\u6597\u4E2D\u88AB\u780D\u4F24\u7684\uFF0C\u6700\u5148\u88AB\u6251\u5012\u5728\u5730\uFF0C\u8150\u70C2\u7684\u810F\u5668\u548C\u80A0\u662F\u5B83\u4EEC\u559C\u6B22\u7684\u3002</p><p>\u5206\u6210\u5341\u4F59\u4E2A\u5708\u5B50\uFF0C\u76F8\u6251\u548C\u8FDB\u98DF\uFF0C\u6050\u6016\u7684\u53EB\u58F0\u56DE\u8361\u5728\u6574\u5EA7\u7687\u57CE\u3002\u4E24\u53EA\u5F02\u578B\u5996\u5973\u6B63\u8DB4\u5728\u686B\u6469\u80EF\u4E0B\u3002</p><p>\u59EC\u5A1C\u7684\u8170\u90E8\u4EE5\u4E0A\u662F\u4EBA\u578B\uFF0C\u4E4B\u4E0B\u662F\u8718\u86DB\u7684\u5C3E\u548C\u516B\u8DB3\u3002\u8D64\u88F8\u7740\u5FAE\u5FAE\u9686\u8D77\u7684\u5C0F\u5DE7\u4E73\u623F\u3002\u686B\u6469\u5FCD\u4E0D\u4F4F\u6309\u538B\u4E0B\u53BB\uFF0C\u5B83\u7ADF\u4E00\u8FB9\u53D1\u51FA\u5BB3\u7F9E\u7684\u58F0\u97F3\u4E00\u8FB9\u7528\u5C0F\u624B\u63A8\u95EA\u7740\u9694\u5F00\u3002</p><p>\u4ED6\u4E8E\u662F\u6765\u4E86\u8DA3\uFF0C\u6487\u5F00\u5FE0\u8BDA\u7684\u8D1D\u73B2\u8FBE\uFF0C\u5C06\u59EC\u5A1C\u6309\u5012\u5728\u5730\u3002\u4E5F\u8BB8\u5B83\u6BD5\u7ADF\u662F\u5E7C\u5973\u7684\u539F\u4F53\uFF0C\u7ADF\u4E0B\u610F\u8BC6\u5730\u6FC0\u53EB\u6323\u624E\u3002</p><p>\u686B\u6469\u4E00\u7528\u52B2\u529B\uFF0C\u7ADF\u5C06\u5B83\u5C0F\u5C0F\u7684\u4E73\u5934\u634F\u788E\uFF0C\u75BC\u5F97\u59EC\u5A1C\u4E00\u9635\u60E8\u53EB\u3002\u4ED6\u5176\u5B9E\u5E76\u4E0D\u60F3\u5978\u6DEB\u5B83\uFF0C\u53EA\u662F\u611F\u5174\u8DA3\u8FD9\u5177\u5E7C\u5973\u8EAB\u578B\u3002\u800C\u59EC\u5A1C\u5C45\u7136\u6B7B\u6B7B\u6323\u624E\uFF0C\u8FD9\u4EE4\u686B\u6469\u9707\u6012\u3002</p><p>\u4ED6\u6233\u7834\u5B83\u8106\u5F31\u7684\u809A\u8110\uFF0C\u5F00\u59CB\u5978\u6DEB\u5B83\u3002\u8D1D\u73B2\u8FBE\u4F3C\u8981\u4E0A\u524D\u963B\u6320\uFF0C\u4ED6\u4E00\u8BB0\u773C\u795E\uFF0C\u4FBF\u4EE4\u5B83\u4E56\u4E56\u7528\u553E\u6DB2\u6ECB\u6DA6\u59B9\u59B9\u7684\u4E73\u623F\u3002</p><p>\u88AB\u5B83\u8214\u8FC7\u7684\u4E73\u623F\u8FC5\u901F\u81A8\u80C0\u8D77\u6765\uFF0C\u59EC\u5A1C\u7684\u9762\u4E0A\u4EA6\u6CDB\u8D77\u5C11\u5973\u7684\u7EA2\u6655\uFF0C\u4F34\u968F\u7740\u88AB\u52A8\u7684\u5A07\u541F\u3002\u800C\u82CD\u5170\u660F\u6B7B\u5728\u4E00\u65C1\uFF0C\u7FC5\u8180\u65E0\u529B\u7684\u644A\u5F00\uFF0C\u6709\u80AE\u810F\u53C8\u7C98\u7A20\u7684\u6DB2\u4F53\u7C98\u5728\u7FBD\u6BDB\u7684\u7EB9\u7406\u3002</p><p>\u6708\u8272\u4E4B\u4E0B\uFF0C\u591C\u666F\u4E0D\u8FC7\u5982\u6B64\u3002</p>',47);function t(c,n){return r}var _=e(a,[["render",t]]);export{_ as default};
